import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Narbar";
import Footer from "./components/Footer";
import Home from "./pages/Home";
import Lessons from "./pages/Lessons";
import Exercise from "./pages/Exercise";
import Admin from "./pages/Admin";
import Variouslessons from "./pages/Variouslessons";
import Testexercise from "./pages/Testexercise";
import Dashboard from "./pages/Dashboard";
import EditLesson from "./pages/EditLesson";
import EditSign from "./pages/EditSign";
import EditExercise from "./pages/EditExercise";
import EditAdmin from "./pages/EditAdmin";
import AddLesson from "./pages/AddLesson";
import AddSign from "./pages/AddSign";
import AddExercise from "./pages/AddExercise";
import AddAdmin from "./pages/AddAdmin";

import Register from "./user/Register";
import Login from "./user/Login";
import GuestLogin from "./user/GuestLogin";


function App() {
  return (
      <Router>
        <Routes path="/register" element={<Register />} />
        <Routes path="/login" element={<Login />} />
        <Routes path="/guest-login" element={<GuestLogin />} />



      <Routes>
        {/* Admin Login Route แบบเต็มจอ ไม่มี Navbar/ Footer */}
        <Route path="/admin/admin" element={<Admin />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/edit-lesson/:id" element={<EditLesson />} />
        <Route path="/edit-word/:lessonId/:signId" element={<EditSign />} />
        <Route path="/edit-exercise/:id" element={<EditExercise />} />
        <Route path="/edit-admin/:id" element={<EditAdmin />} />
        <Route path="/add-lesson" element={<AddLesson />} />
        <Route path="/add-sign" element={<AddSign />} />
        <Route path="/add-exercise" element={<AddExercise />} />
        <Route path="/add-admin" element={<AddAdmin />} />


        {/* Routes ปกติที่มี Navbar + Footer */}
        <Route
          path="*"
          element={
            <div className="flex flex-col min-h-screen">
              <Navbar />
              <main className="flex-grow">
                <Routes>
                  <Route path="/" element={<Home />} />
                  <Route path="/lessons" element={<Lessons />} />
                  <Route path="/exercises" element={<Exercise />} />
                  <Route path="/lessons/:id" element={<Variouslessons />} />
                  <Route path="/exercises/lesson/:lessonNumber" element={<Testexercise />} />

                </Routes>
              </main>
              <Footer />
            </div>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
